import React from 'react'
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';

function Admin() {
  return (
    <div className='container'>
    <Box
      component="form"
      sx={{
        // m: "auto", width: '45ch',p:"15px" ,
        '& > :not(style)': { display:"flex",justifyContent:"center",marginBottom:"30px",color:"red"},
      }}
      
      noValidate
      autoComplete="off"
    >
     <h4>fill product details</h4>
      <TextField id="filled-basic" label="rname" variant="filled" color='red' />
      <TextField id="filled-basic" label="imgdata" variant="filled" />
      <TextField id="filled-basic" label="address" variant="filled" />
      <TextField id="filled-basic" label="delimg" variant="filled" />
      <TextField id="filled-basic" label="somedata" variant="filled" />
      {/* <TextField id="filled-basic" label="somedata" variant="filled" /> */}
      <TextField id="filled-basic" label="rating" variant="filled" />
      <TextField id="filled-basic" label="arrimg" variant="filled" />
    </Box>
    </div>
  )
}

export default Admin
